import React from 'react';
import FormTemplate from './form';

const LoginForm = () => {

    const login = fields => {
        console.log(fields)
    };

    const fields =  {
        email: { displayName: "Email", type: "email", value: "" },
        password: { displayName: "Password", type: "password", value: "" }
    };

    return (
        <FormTemplate 
            fields={fields} 
            submit={login}  
            header="Sign In"
        />
    )

};

export default LoginForm;
